import React from "react";
import QRCode from "qrcode.react";

function SuccessfulSignup(props) {
	console.log(props.qrData);
	return (
		<div>
			<p>Sucess Message</p>
			<QRCode value={props.qrData} size={300} />
		</div>
	);
}

export default SuccessfulSignup;
